import React from 'react'
import {connect} from "react-redux";

import Layout from "../_layouts/default/Layout";

class SuggestPage extends React.Component {

    render() {
        return (
            <Layout drawer>
                <div>
                    Suggest Form
                </div>
            </Layout>
        )
    }
}

export default connect()(SuggestPage)
